const apiUrl = "";


const Button = styled.button`
    color:  #5FA772

`;


const HomePage = () => {


    const data = fixture;//fileUpload;
    console.log(data);


    const handleSubmit = async () => {
        try {
            const result = await fetch(apiUrl, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            });

            if (result.ok) {
                console.log(result);
            } else {
                throw new Error();
            }
        } catch (e) {
            console.log(e);
        }
    };



    return (
		<>
			<div className="row">
				<div>
					<h4>Hello World</h4>

				</div>
			</div>
			{(

			<form>
                <input type={"file"} accept={".csv"} />
                <Button>IMPORT CSV</Button>
            </form>

			)}
		</>
	)
};

export default HomePage;
